import React from "react";
import {NavLink} from 'react-router-dom';

function Nav(){
    return (
        <div className="nav-bar">
            <NavLink
            to="/"
            exact
            className="nav-links"
            >
                Home
            </NavLink>
            <NavLink to="/recipes">Recipes</NavLink>
            <NavLink>Add a New Recipe</NavLink>
        </div>
    )
}

export default Nav;
